window.bookSummaryJSON = "<p><b>From </b><b><i>New York Times</i></b><b> best-selling author, Penelope Douglas, comes a new stand-alone! </b></p> <p><b>Three of them, one of her, and a remote cabin in the woods. Let the hot winter nights ensue....</b></p> <p>Tiernan de Haas doesn’t care about anything anymore. The only child of a film producer and his starlet wife, she’s grown up with wealth and privilege but not love or guidance. Shipped off to boarding schools from an early age, it was still impossible to escape the loneliness and carve out a life of her own. The shadow of her parents’ fame followed her everywhere. </p> <p>And when they suddenly pass away, she knows she should be devastated. But has anything really changed? She’s always been alone, hasn’t she? </p> <p>Jake Van der Berg, her father’s stepbrother and her only living relative, assumes guardianship of Tiernan who is still two months shy of 18. Sent to live with him and his two sons, Noah and Kaleb, in the mountains of Colorado, Tiernan soon learns that these men now have a say in what she chooses to care and not care about anymore. </p> <p>As the three of them take her under their wing, teach her to work and survive in the remote woods far away from the rest of the world, she slowly finds her place among them. </p> <p>And as a part of them.</p> <p>She also realizes that lines blur and rules become easy to break when no one else is watching.</p> <p>One of them has her.</p> <p>The other one wants her.</p> <p>But he....</p> <p>He’s going to keep her.</p> <p>*<i>Credence </i>is a full length, stand-alone romance suitable for listeners 18+.</p>"; 
